import react from "react";
import { Link } from "react-router-dom";

export default function Header() {
    return (
        <div className="header">
            <Link to="/" className="to-main-logo">
                <img src="/images/logo.png" />
            </Link>
            <nav>
                <Link to="/" className="text-nav">진화표</Link>
            </nav>
        </div>
    );
}
